import { ProductCardContainer } from "./productCardStyle";

const ProductCard = ({ addToCart, imageUrl, id, name, value, product}) => {


  return (<>
      <h3>Quantidade de produtos: 6</h3>
      <ProductCardContainer>

          <img src={imageUrl} alt={`imagem de ${name}`} />
          <p>{`Número ${id}`}</p>
          <h1>{name}</h1>
          <h2>{`R$ ${value}`}</h2>
          <button
            onClick={()=>addToCart(product)}>
            Adicionar ao Carrinho
          </button>

      </ProductCardContainer>
    </>
  );
};

export default ProductCard;
